// src/components/Navbar.js

import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';

const Navbar = ({ isAdminLoggedIn, handleLogout }) => {
    return (
        <nav className="navbar">
            <ul>
                <li><Link to="/">Home</Link></li>
                <li><Link to="/reviews">Reviews</Link></li>
                {isAdminLoggedIn && (
                    <>
                        <li><Link to="/admin">Admin Dashboard</Link></li>
                        <li><Link to="/admin/unapproved">Unapproved Reviews</Link></li>
                        <li className="logout-button"><button onClick={handleLogout}>Logout</button></li>
                    </>
                )}
                {!isAdminLoggedIn && <li><Link to="/login">Admin Login</Link></li>}
            </ul>
        </nav>
    );
};

export default Navbar;
